interface CardProps {
    imageee: string;
    buyer: string;
    seller: string;
    imageBuyer: string;
    unitcost: string;
    xirr: string;
    tenure: string;
  }

export const CardComponent: React.FC<CardProps> = ({
  imageee,
  buyer,
  seller,
  imageBuyer,
  unitcost,
  xirr,
  tenure,
}) => {
  return (
    <div className="bg-white shadow-md rounded-lg overflow-hidden m-4 p-4">
      <img className="w-full h-24 object-cover" src={imageee} alt="Product" />
      <div className="flex items-center mt-4">
        <img className="w-12 h-12 rounded-full" src={imageBuyer} alt="Buyer" />
        <div className="ml-4">
          <h3 className="text-lg font-semibold">{buyer}</h3>
          <p className="text-gray-600">{seller}</p>
        </div>
      </div>
      <div className="mt-4">
        <p className="text-gray-600">Unit Cost: {unitcost}</p>
        <p className="text-gray-600">XIRR: {xirr}</p>
        <p className="text-gray-600">Tenure: {tenure} months</p>
      </div>
    </div>
  );
};
